// src/components/sections/Projects.jsx
import React from 'react';
import { useTheme } from "../../context/ThemeContext";
import ProjectCard from '../ui/ProjectCard';

const Projects = () => {
  const { darkMode } = useTheme();
  const [loading, setLoading] = React.useState(false);
  const [error, setError] = React.useState(null);
  const [projects, setProjects] = React.useState([]);

  const demoProjects = [
    {
      id: 1,
      title: "E-commerce de Location",
      description: "Plateforme de location de matériel de vacances avec système de réservation et paiement intégré.",
      image: "/images/projects/ecommerce.jpg",
      technologies: ["React", "Symfony", "TailwindCSS", "MySQL"],
      githubLink: "#",
      liveLink: "#"
    },
    {
      id: 2,
      title: "Dashboard de Gestion",
      description: "Interface d'administration pour gérer les commandes clients et suivre les modifications en temps réel.",
      image: "/images/projects/dashboard.jpg",
      technologies: ["React", "Symfony", "TailwindCSS", "MySQL"],
      githubLink: "#",
      liveLink: "#"
    },
    {
      id: 3,
      title: "Site Vitrine Restauration",
      description: "Site élégant pour un restaurant avec galerie de plats, réservation de tables et menu interactif.",
      image: "/images/projects/restaurant.jpg",
      technologies: ["React", "TailwindCSS", "JavaScript", "Responsive"],
      githubLink: "#",
      liveLink: "#"
    },
    {
      id: 4,
      title: "Plateforme de Trading",
      description: "Site de formation au trading avec système d'abonnement, cours vidéo et analyses en temps réel.",
      image: "/images/projects/trading.jpg",
      technologies: ["React", "Node.js", "Python", "TailwindCSS", "MySQL"],
      githubLink: "#",
      liveLink: "#"
    }
  ];

  React.useEffect(() => {
    const loadProjects = async () => {
      try {
        setLoading(true);
        setError(null);
        const data = await fetchProjects();
        if (Array.isArray(data)) {
          setProjects(data);
        } else {
          throw new Error('Format de données invalide');
        }
      } catch (err) {
        console.error('Erreur lors du chargement des projets:', err);
        setError(err.message);
        setProjects([]);
      } finally {
        setLoading(false);
      }
    };

    loadProjects();
  }, []);

  if (loading) {
    return (
      <section id="projects" className="py-12 sm:py-16 relative overflow-hidden">
        <div className="absolute inset-0 pointer-events-none">
          <div className={`absolute top-20 left-10 w-72 h-72 ${darkMode ? 'bg-purple-500/5' : 'bg-purple-500/10'} rounded-full blur-3xl`}></div>
        </div>
        <div className="max-w-6xl mx-auto px-4 relative">
          <div className="text-center">
            <div className="inline-block w-12 h-12 border-4 border-t-blue-500 border-gray-300 rounded-full animate-spin"></div>
            <p className={`mt-4 ${darkMode ? 'text-gray-400' : 'text-gray-600'}`}>
              Chargement des projets...
            </p>
          </div>
        </div>
      </section>
    );
  }

  if (error) {
    return (
      <section id="projects" className="py-12 sm:py-16">
        <div className="max-w-6xl mx-auto px-4">
          <div className={`p-6 rounded-xl border ${
            darkMode 
              ? 'bg-red-900/20 border-red-800 text-red-400' 
              : 'bg-red-50 border-red-200 text-red-600'
          }`}>
            <div className="flex items-center gap-3">
              <svg className="w-6 h-6 flex-shrink-0" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
              </svg>
              <p>Erreur: {error}</p>
            </div>
          </div>
        </div>
      </section>
    );
  }

  return (
    <section id="projects" className="py-12 sm:py-16 relative overflow-hidden">
      {/* Background décoratif */}
      <div className="absolute inset-0 pointer-events-none">
        <div className={`absolute top-20 left-10 w-72 h-72 ${darkMode ? 'bg-purple-500/5' : 'bg-purple-500/10'} rounded-full blur-3xl`}></div>
        <div className={`absolute bottom-20 right-10 w-96 h-96 ${darkMode ? 'bg-blue-500/5' : 'bg-blue-500/10'} rounded-full blur-3xl`}></div>
      </div>

      <div className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 relative">
        {/* Header */}
        <div className="text-center mb-10 sm:mb-12">
          <div className={`inline-flex items-center gap-2 px-4 py-2 rounded-full mb-4 ${
            darkMode 
              ? 'bg-purple-500/10 border border-purple-500/20' 
              : 'bg-purple-50 border border-purple-200'
          }`}>
            <svg className={`w-4 h-4 ${darkMode ? 'text-purple-400' : 'text-purple-600'}`} fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M19 11H5m14 0a2 2 0 012 2v6a2 2 0 01-2 2H5a2 2 0 01-2-2v-6a2 2 0 012-2m14 0V9a2 2 0 00-2-2M5 11V9a2 2 0 012-2m0 0V5a2 2 0 012-2h6a2 2 0 012 2v2M7 7h10" />
            </svg>
            <span className={`text-sm font-semibold ${darkMode ? 'text-purple-400' : 'text-purple-600'}`}>
              Portfolio
            </span>
          </div>

          <h2 className={`text-2xl sm:text-3xl md:text-4xl font-bold mb-3 sm:mb-4 ${
            darkMode ? "text-white" : "text-gray-900"
          }`}>
            Projets Récents
          </h2>

          <p className={`max-w-2xl mx-auto text-sm sm:text-base ${
            darkMode ? "text-gray-400" : "text-gray-600"
          }`}>
            Quelques-unes de mes réalisations, démontrant mes compétences en développement web
          </p>
        </div>

        {/* Grille de projets */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6 sm:gap-8">
          {(projects.length > 0 ? projects : demoProjects).map((project, index) => (
            <ProjectCard
              key={project.id}
              project={project}
              index={index}
              darkMode={darkMode}
            />
          ))}
        </div>

       {/* CTA Voir plus */}
<div className="text-center mt-10 sm:mt-12">

    href="https://github.com/votre-username"
    target="_blank"
    rel="noopener noreferrer"
    className={`inline-flex items-center gap-2 px-6 py-3 rounded-xl font-semibold transition-all duration-300 ${
      darkMode
        ? 'bg-gradient-to-r from-purple-600 to-blue-600 hover:from-purple-500 hover:to-blue-500 text-white'
        : 'bg-gradient-to-r from-purple-500 to-blue-500 hover:from-purple-600 hover:to-blue-600 text-white'
    } shadow-lg hover:shadow-xl hover:scale-105`}
  <a
  >
    <span>Voir plus sur GitHub</span>
    <svg className="w-5 h-5" fill="currentColor" viewBox="0 0 24 24">
      <path d="M12 0c-6.626 0-12 5.373-12 12 0 5.302 3.438 9.8 8.207 11.387.599.111.793-.261.793-.577v-2.234c-3.338.726-4.033-1.416-4.033-1.416-.546-1.387-1.333-1.756-1.333-1.756-1.089-.745.083-.729.083-.729 1.205.084 1.839 1.237 1.839 1.237 1.07 1.834 2.807 1.304 3.492.997.107-.775.418-1.305.762-1.604-2.665-.305-5.467-1.334-5.467-5.931 0-1.311.469-2.381 1.236-3.221-.124-.303-.535-1.524.117-3.176 0 0 1.008-.322 3.301 1.23.957-.266 1.983-.399 3.003-.404 1.02.005 2.047.138 3.006.404 2.291-1.552 3.297-1.23 3.297-1.23.653 1.653.242 2.874.118 3.176.77.84 1.235 1.911 1.235 3.221 0 4.609-2.807 5.624-5.479 5.921.43.372.823 1.102.823 2.222v3.293c0 .319.192.694.801.576 4.765-1.589 8.199-6.086 8.199-11.386 0-6.627-5.373-12-12-12z"/>
    </svg>
  </a>
</div>
      </div>
    </section>
  );
};

export default Projects;
